import React from 'react'
import Backdrop from '../Overlay/Backdrop/Backdrop'
import Modal from '../Overlay/Modal/Modal'

const ChangeContribution = (props) => {
  return (
    <Backdrop takeback={props.takeback}>
      <Modal>
        <h2>Current Minimum Contribution Value</h2>
      </Modal>
    </Backdrop>
  )
}

export default ChangeContribution
